import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>First Link Tetsing page</h1>
      <span>Home</span><br></br>
      <span><a href='./home'>Contact</a></span><br></br>
      <span>About</span>
    </div>
  );
}

export default App;
